  CREATE OR REPLACE PROCEDURE "ACR_GB"."ACRGBFACILITYTAGGING" (
    Message OUT VARCHAR2,
    Code    OUT NUMBER,
    upmcc_no       IN ACR_GB.HCI_ANC_SERVICE_HIST.HCI_NO%TYPE,
    uservicetype   IN ACR_GB.HCI_ANC_SERVICE_HIST.ANC_SERVICE_TYPE%TYPE,
    udatestart     IN ACR_GB.HCI_ANC_SERVICE_HIST.START_DATE%TYPE,
    udateended     IN ACR_GB.HCI_ANC_SERVICE_HIST.EXPIRE_DATE%TYPE,
    ucreator       IN ACR_GB.HCI_ANC_SERVICE_HIST.USER_NAME%TYPE,
    udatecreated   IN ACR_GB.HCI_ANC_SERVICE_HIST.ENTRY_DATE%TYPE,
    udateissue     IN ACR_GB.HCI_ANC_SERVICE_HIST.ISSUE_DATE%TYPE,
    udateeffective IN ACR_GB.HCI_ANC_SERVICE_HIST.EFF_DATE%TYPE
) AS
BEGIN
    VALUES (upmcc_no,uservicetype,udatestart,udateended,ucreator,udatecreated,udateissue,udateeffective);
    Message:='SUCC';
    Code:=00;
    Exception
    when others then
    Message :='An error was encounter while Inserting Data in HCI_ANC_SERVICE_HIST '||sqlcode||'-error-'||sqlerrm;
    Code :=01;
END ACRGBFACILITYTAGGING;

