  CREATE OR REPLACE PROCEDURE "ACR_GB"."INSERTCLAIMS" (
        Message OUT VARCHAR2,
        Code OUT NUMBER,
        useries IN NCLAIMS.SERIES%TYPE,
        uaccreno IN NCLAIMS.ACCRENO%TYPE,
        upmccno IN NCLAIMS.PMCC_NO%TYPE,
        udateadmission IN NCLAIMS.DATE_ADM%TYPE,
        udatesubmitted IN NCLAIMS.DATESUBMITTED%TYPE,
        urefiledate IN NCLAIMS.REFILEDATE%TYPE,
        uclaimamount IN NCLAIMS.CLAIMAMOUNT%TYPE,
        utags IN NCLAIMS.TAGS%TYPE,
        utrn IN NCLAIMS.TRN%TYPE,
        uclaimid IN NCLAIMS.CLAIMID%TYPE,
        uhcfname IN NCLAIMS.HCFNAME%TYPE,
        c1icdcode IN NCLAIMS.C1_ICD_CODE%TYPE,
        c1rvcode IN NCLAIMS.C1_RVS_CODE%TYPE,
        c2icdcode IN NCLAIMS.C2_ICD_CODE%TYPE,
        c2rvcode IN NCLAIMS.C2_RVS_CODE%TYPE,
        uopdtst IN NCLAIMS.OPD_TST%TYPE)
AS
BEGIN
        OPD_TST,
        C1_RVS_CODE,C2_RVS_CODE,C1_ICD_CODE,C2_ICD_CODE,
        SERIES,ACCRENO,PMCC_NO,DATE_ADM,DATESUBMITTED,CLAIMAMOUNT,TAGS,TRN,CLAIMID,HCFNAME,REFILEDATE) 
        VALUES (
        uopdtst,
        c1rvcode,c2rvcode,c1icdcode,c2icdcode,
        useries,
        uaccreno,
        upmccno,
        udateadmission,
        udatesubmitted,
        uclaimamount,
        utags,
        utrn,
        uclaimid,
        uhcfname,urefiledate);    
    Message:='SUCC';
    Code:=00;
Exception
when others then
-- DBMS_OUTPUT.PUT_LINE('An error was encounter while Inserting Claims'||sqlcode||'-error-'||sqlerrm);
Message :='An error was encounter while Inserting Claims'||sqlcode||'-error-'||sqlerrm;
Code :=01;
  --COMMIT; create exception for out put message
END INSERTCLAIMS;

