FUNCTION GETNCLAIMS(
      upmccno IN NCLAIMS.PMCC_NO%TYPE,
      u_tags IN NCLAIMS.TAGS%TYPE,
      u_from IN NCLAIMS.DATE_ADM%TYPE,
      u_to IN NCLAIMS.DATESUBMITTED%TYPE) RETURN SYS_REFCURSOR 
      IS
      v_result SYS_REFCURSOR;
      BEGIN
          OPEN v_result FOR 
          SELECT 
          SUM(CAST(CLAIMAMOUNT AS NUMBER)) AS CTOTAL,
          PMCC_NO,
          C2_RVS_CODE,
          C2_ICD_CODE,
          C1_RVS_CODE,
          C1_ICD_CODE,
          TRUNC(REFILEDATE) AS DATEREFILE,
          COUNT(PMCC_NO) AS COUNTVAL,
          TRUNC(DATESUBMITTED) AS DATESUB,
          TRUNC(DATE_ADM) AS DATEADM
          FROM ACR_GB.NCLAIMS 
          WHERE OPD_TST='F' 
          AND PMCC_NO=upmccno 
          AND TAGS=u_tags  
          AND 
         (TO_DATE(DATE_ADM,'DD-MON-YY') BETWEEN TO_DATE(u_from,'DD-MON-YY') 
          AND TO_DATE(u_to,'DD-MON-YY')) 
          GROUP BY 
          PMCC_NO,
          TRUNC(DATE_ADM),
          TRUNC(REFILEDATE),
          TRUNC(DATESUBMITTED),
          C1_RVS_CODE,
          C2_RVS_CODE,
          C2_ICD_CODE,
          C1_ICD_CODE
          ORDER BY TRUNC(DATE_ADM) ASC; 
          RETURN v_result;   
END GETNCLAIMS;
