PROCEDURE AUTOBOOKDATA(
  Message   OUT VARCHAR2,
  Code      OUT NUMBER,
  ubooknum  IN VARCHAR2,
  upmmcno   IN NCLAIMS.PMCC_NO%TYPE,
  utags     IN NCLAIMS.TAGS%TYPE,
  udatefrom IN NCLAIMS.DATE_ADM%TYPE,
  udateto   IN NCLAIMS.DATESUBMITTED%TYPE)
IS
BEGIN
    MERGE INTO ACR_GB.ACR_BOOK_DATA t1
    USING (SELECT SERIES,ACCRENO,DATE_ADM,DATESUBMITTED,CLAIMAMOUNT,TAGS,TRN,PMCC_NO,
    CLAIMID,HCFNAME,C1_RVS_CODE,C2_RVS_CODE,C1_ICD_CODE,C2_ICD_CODE,REFILEDATE FROM ACR_GB.NCLAIMS  WHERE  OPD_TST='F' 
    AND PMCC_NO=upmmcno AND TAGS='G' AND (TO_DATE(DATE_ADM,'DD-MON-YY') BETWEEN TO_DATE(udatefrom,'DD-MON-YY') AND TO_DATE(udateto,'DD-MON-YY'))) t2
    ON (t1.SERIES = t2.SERIES) WHEN NOT MATCHED THEN
    INSERT VALUES (t2.SERIES,t2.ACCRENO,t2.DATE_ADM,t2.DATESUBMITTED,t2.CLAIMAMOUNT,ubooknum,t2.TAGS,t2.TRN,t2.PMCC_NO,
    t2.CLAIMID,t2.HCFNAME,t2.C1_RVS_CODE,t2.C2_RVS_CODE,t2.C1_ICD_CODE,t2.C2_ICD_CODE,t2.REFILEDATE);  
    Message:='SUCC';
    Code:=00;
Exception
when others then
Message :='An error was encounter while booking Claims data'||sqlcode||'-error-'||sqlerrm;
Code :=01;
  --COMMIT; create exception for out put message
END AUTOBOOKDATA;
