FUNCTION GETFULLDETAILS(p_userid IN ACR_USER_TBL.USERID%TYPE) RETURN SYS_REFCURSOR IS
        v_result SYS_REFCURSOR;
    BEGIN
    OPEN v_result FOR 
        SELECT  
        a.USERID,a.LEVELID,a.USERNAME,a.DID,
        b.FIRSTNAME,b.LASTNAME,b.MIDDLENAME,b.DID AS BDID, b.DATECREATED,
        c.LEVNAME
        FROM ACR_GB.ACR_USER_TBL  a 
        JOIN ACR_GB.ACR_USER_DETAILS_TBL  b
        ON a.DID = b.DID
        JOIN ACR_GB.ACR_USER_LEVEL_TBL c
        ON a.LEVELID = c.LEVELID WHERE a.USERID=p_userid;
    RETURN v_result;
END GETFULLDETAILS;
