  FUNCTION GETSUMMARY(
  utags IN VARCHAR2,
  phcfid IN ACR_ASSETS_TBL.HCFID%TYPE,
  utranchid IN ACR_ASSETS_TBL.TRANCHID%TYPE,
  uconid IN ACR_ASSETS_TBL.CONID%TYPE) RETURN SYS_REFCURSOR 
IS
 v_result SYS_REFCURSOR;
BEGIN
---------------------
IF(utags='ACTIVE') THEN
    IF(uconid=0) THEN
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID 
            FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS='2' GROUP BY HCFID;
        ELSE
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS='2' AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    ELSE
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS='2' AND CONID=uconid GROUP BY HCFID;
        ELSE
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS='2' AND CONID=uconid AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    END IF;
ELSE
    IF(uconid=0) THEN
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' GROUP BY HCFID;
        ELSE
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    ELSE
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' AND CONID=uconid GROUP BY HCFID;
        ELSE
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(CAST(RELEASEDAMOUNT AS NUMBER)) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' AND CONID=uconid AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    END IF;
END IF;
RETURN v_result;
    -- TODO: Implementation required for FUNCTION ACRGBPACKAGE.ACR_ACCOUNTS_PAYABLE_TBL
END GETSUMMARY;
