            COUNT(PMCC_NO) AS CLAIMSVOLUME,
            TRUNC(REFILEDATE) AS DATEREFILE,
            TRUNC(DATESUBMITTED) AS DATESUB,
            TRUNC(DATE_ADM) AS DATEADM,
            PMCC_NO
            FROM                   
            ACR_GB.ACR_BOOK_DATA WHERE PMCC_NO=upmmcno AND TAGS=utags AND 
          (TO_DATE(DATE_ADM,'DD-MON-YY') BETWEEN TO_DATE(udatefrom,'DD-MON-YY') AND TO_DATE(udateto,'DD-MON-YY')) 
          GROUP BY 
          PMCC_NO,
          TRUNC(DATE_ADM),
          TRUNC(REFILEDATE),
          TRUNC(DATESUBMITTED) ORDER BY TRUNC(DATE_ADM) ASC;
    RETURN v_result;
  END GETSUMAMOUNTCLAIMSBOOKDATA;
