FUNCTION GETVALIDATECODE(utags IN VARCHAR2, ucode IN VARCHAR2) RETURN SYS_REFCURSOR IS
   v_result SYS_REFCURSOR;
BEGIN
        CASE
            WHEN utags = 'PRIMARY' THEN
                OPEN v_result FOR 
                SELECT  CODE,AMOUNT
                FROM ACR_GB.ACR_PRIMARY_CRI WHERE CODE=ucode;  
            WHEN utags = 'SECONDARY' THEN
                OPEN v_result FOR 
                SELECT  CODE,AMOUNT
                FROM ACR_GB.ACR_SECONDARY_CRI WHERE CODE=ucode;  
            WHEN utags = 'ZBEN' THEN
                OPEN v_result FOR 
                SELECT  CODE,AMOUNT
                FROM ACR_GB.ACR_ZBEN_CODE WHERE CODE=ucode; 
            WHEN utags = 'PCF' THEN
                OPEN v_result FOR 
                SELECT  CODE,AMOUNT
                FROM ACR_GB.ACR_PCF_CRI WHERE CODE=ucode;  
            WHEN utags = 'PCFEXCLUDED' THEN
                OPEN v_result FOR 
                SELECT  CODE,I_PRICE AS AMOUNT
                FROM ACR_GB.ACR_EXCLUDED_CODE WHERE CODE=ucode;  
            WHEN utags = 'PEXCLUDED' THEN
                OPEN v_result FOR 
                SELECT  CODE,P_PRICE AS AMOUNT
                FROM ACR_GB.ACR_EXCLUDED_CODE WHERE CODE=ucode;  
            WHEN utags = 'SEXCLUDED' THEN
                OPEN v_result FOR 
                SELECT  CODE,S_PRICE AS AMOUNT
                FROM ACR_GB.ACR_EXCLUDED_CODE WHERE CODE=ucode;  
        END CASE;
    RETURN v_result;
END GETVALIDATECODE;  
