FUNCTION GETENDCONOPENCONSTATE(utags IN VARCHAR2, 
                               uhcfcode IN VARCHAR2,
                               ustate IN VARCHAR2) RETURN SYS_REFCURSOR IS
    v_result SYS_REFCURSOR;
     ustates NUMBER;
    BEGIN
    IF(ustate='OPEN') THEN
        ustates:=2;
    ELSE
        ustates:=3;
    END IF;
    IF(utags='ACTIVE') THEN
        OPEN v_result FOR 
        SELECT  a.QUARTER,a.SB,a.ADDAMOUNT,a.C_CLAIMSVOL,a.T_CLAIMSVOL,a.CONID,
             a.HCFID,a.AMOUNT,a.STATS,a.CREATEDBY,a.DATECREATED,
             a.CONTRACTDATE,a.TRANSCODE,a.BASEAMOUNT,a.REMARKS,a.ENDDATE 
             FROM ACR_GB.ACR_CONTRACT_TBL a
             JOIN ACR_CONTRACT_DATE_TBL b
             ON a.CONTRACTDATE = b.CONDATEID
             WHERE a.HCFID=uhcfcode  AND  a.STATS='2' AND a.STATE=ustates;
    ELSE
        OPEN v_result FOR 
        SELECT  a.QUARTER,a.SB,a.ADDAMOUNT,a.C_CLAIMSVOL,a.T_CLAIMSVOL,a.CONID,
             a.HCFID,a.AMOUNT,a.STATS,a.CREATEDBY,a.DATECREATED,
             a.CONTRACTDATE,a.TRANSCODE,a.BASEAMOUNT,a.REMARKS,a.ENDDATE 
             FROM ACR_GB.ACR_CONTRACT_TBL a
             JOIN ACR_CONTRACT_DATE_TBL b
             ON a.CONTRACTDATE = b.CONDATEID
             WHERE a.HCFID=uhcfcode   AND a.STATS!='2' AND a.STATE=ustates;
    
    END IF;
        RETURN v_result;
END GETENDCONOPENCONSTATE;
