 v_results SYS_REFCURSOR;
BEGIN
  OPEN v_results FOR 
  SELECT  SERIES,ERROR_CODE,DATA,DESCRIPTION,LHIO,CLAIM_ID FROM MINOSUN.DRG_WARNING_ERROR WHERE SERIES=useries;
  RETURN v_results;
END WARNINGERROR;
--------------------------------------------------------------------------------
FUNCTION  PROCEDURES(useries IN MINOSUN.DRG_PROCEDURE.SERIES%TYPE) RETURN SYS_REFCURSOR
IS
 v_results SYS_REFCURSOR;
BEGIN
  OPEN v_results FOR 
  SELECT  RVS,LATERALITY,EXT1_CODE,EXT2_CODE,SERIES,LHIO,CLAIM_ID 
  FROM MINOSUN.DRG_PROCEDURE WHERE SERIES=useries GROUP BY RVS,LATERALITY,EXT1_CODE,EXT2_CODE,SERIES,LHIO,CLAIM_ID;
  RETURN v_results;
END PROCEDURES;
