FUNCTION  SECONDARY(useries IN MINOSUN.DRG_DIAGNOSIS.SERIES%TYPE) RETURN SYS_REFCURSOR
IS
 v_results SYS_REFCURSOR;
BEGIN
  OPEN v_results FOR 
