PROCEDURE INACTIVEDATA(Message OUT VARCHAR2,
        Code OUT NUMBER,
        tags IN VARCHAR,
        dataid IN VARCHAR)
AS
BEGIN
--CASE STATEMENT AREA
CASE
     WHEN tags = 'ASSETS' THEN
        UPDATE ACR_GB.ACR_ASSETS_TBL SET STATS='3' WHERE ASSETSID=CAST(dataid AS NUMBER);
     WHEN tags = 'CONTRACT' THEN
        UPDATE ACR_GB.ACR_CONTRACT_TBL SET STATS='3' WHERE CONID=CAST(dataid AS NUMBER);
     WHEN tags = 'TRANCH' THEN
        UPDATE ACR_GB.ACR_TRANCH_TBL SET STATS='3' WHERE TRANCHID=CAST(dataid AS NUMBER);
     WHEN tags = 'USERDETAILS' THEN
        UPDATE ACR_GB.ACR_USER_DETAILS_TBL SET STATS='3' WHERE DID=CAST(dataid AS NUMBER);
     WHEN tags = 'USERLEVEL' THEN
        UPDATE ACR_GB.ACR_USER_LEVEL_TBL SET STATS='3' WHERE LEVELID=CAST(dataid AS NUMBER);
     WHEN tags = 'USER' THEN
        UPDATE ACR_GB.ACR_USER_TBL SET STATS='3' WHERE USERID=CAST(dataid AS NUMBER);
     WHEN tags = 'CONBAL' THEN
        UPDATE ACR_GB.ACR_CON_BALANCE SET STATUS='3' WHERE ACCOUNT=dataid AND STATUS='2';
     WHEN tags = 'CONSTATE' THEN
        UPDATE ACR_GB.ACR_CONTRACT_TBL SET STATE='3' WHERE HCFID=dataid AND STATS!='2' AND STATE='2';
     WHEN tags = 'CONTRACTDATE' THEN
        UPDATE ACR_GB.ACR_CONTRACT_DATE_TBL SET STATUS='3' WHERE CONDATEID=CAST(dataid AS NUMBER) AND STATUS='2';
END CASE;
-- END OF STATEMENT AREA
    Message:='SUCC';
    Code:=00;
Exception
when others then
Message :='An error was encounter while Inserting Claims'||sqlcode||'-error-'||sqlerrm;
Code :=01;
  --COMMIT; create exception for out put message
END INACTIVEDATA;
-------------------------------------------------------------------------------------------------------------
PROCEDURE ACTIVEDATA(Message OUT VARCHAR2,
        Code OUT NUMBER,
        tags IN VARCHAR,
        dataid IN VARCHAR)
AS
BEGIN
CASE
     WHEN tags = 'ASSETS' THEN
        UPDATE ACR_GB.ACR_ASSETS_TBL SET STATS='2' WHERE ASSETSID=CAST(dataid AS NUMBER);
     WHEN tags = 'CONTRACT' THEN
        UPDATE ACR_GB.ACR_CONTRACT_TBL SET STATS='2' WHERE CONID=CAST(dataid AS NUMBER);
     WHEN tags = 'TRANCH' THEN
        UPDATE ACR_GB.ACR_TRANCH_TBL SET STATS='2' WHERE TRANCHID=CAST(dataid AS NUMBER);
     WHEN tags = 'USERDETAILS' THEN
        UPDATE ACR_GB.ACR_USER_DETAILS_TBL SET STATS='2' WHERE DID=CAST(dataid AS NUMBER);
     WHEN tags = 'USERLEVEL' THEN
        UPDATE ACR_GB.ACR_USER_LEVEL_TBL SET STATS='2' WHERE LEVELID=CAST(dataid AS NUMBER);
     WHEN tags = 'USER' THEN
        UPDATE ACR_GB.ACR_USER_TBL SET STATS='2' WHERE USERID=CAST(dataid AS NUMBER);
     WHEN tags = 'CONBAL' THEN
        UPDATE ACR_GB.ACR_CON_BALANCE SET STATUS='2' WHERE ACCOUNT=dataid AND STATUS='2';
     WHEN tags = 'CONSTATE' THEN
        UPDATE ACR_GB.ACR_CONTRACT_TBL SET STATE='2' WHERE CONID=CAST(dataid AS NUMBER) AND STATS='3';
END CASE;


-- END OF STATEMENT AREA
    Message:='SUCC';
    Code:=00;
Exception
when others then
Message :='An error was encounter while update status'||sqlcode||'-error-'||sqlerrm;
Code :=01;
  --COMMIT; create exception for out put message
END ACTIVEDATA;
