PROCEDURE DELETEDATA(Message OUT VARCHAR2,
        Code OUT NUMBER,
        p_tags IN VARCHAR,
        p_dataid IN NUMBER)
AS
BEGIN
--CASE STATEMENT AREA
CASE
     WHEN p_tags = 'ASSETS' THEN
    DELETE FROM ACR_GB.ACR_ASSETS_TBL  WHERE ASSETSID=p_dataid AND  STATS='3';
     WHEN p_tags = 'CONTRACT' THEN
    DELETE FROM ACR_GB.ACR_CONTRACT_TBL  WHERE CONID=p_dataid AND  STATS='3';
     WHEN p_tags = 'TRANCH' THEN
    DELETE FROM ACR_GB.ACR_TRANCH_TBL WHERE TRANCHID=p_dataid AND  STATS='3';
     WHEN p_tags = 'USERDETAILS' THEN
    DELETE FROM ACR_GB.ACR_USER_DETAILS_TBL  WHERE DID=p_dataid AND  STATS='3';
     WHEN p_tags = 'USERLEVEL' THEN
    DELETE FROM ACR_GB.ACR_USER_LEVEL_TBL WHERE LEVELID=p_dataid AND  STATS='3';
     WHEN p_tags = 'USER' THEN
    DELETE FROM ACR_GB.ACR_USER_TBL  WHERE USERID=p_dataid AND  STATS='3';
END CASE;
-- END OF STATEMENT AREA
    Message:='SUCC';
    Code:=00;
Exception
when others then
Message :='An error was encounter while Inserting Claims'||sqlcode||'-error-'||sqlerrm;
Code :=01;
  --COMMIT; create exception for out put message
END DELETEDATA;
