PROCEDURE UPDATEHCPNACCREDITATION(
        Message OUT VARCHAR2,
        Code OUT NUMBER,
        paccount IN ACR_ACCREDITATION.ACCRENO%TYPE,
        pdateaction IN ACR_ACCREDITATION.DATECREATED%TYPE,
        pcreatedby IN ACR_ACCREDITATION.CREATEDBY%TYPE,
        pstatus IN ACR_ACCREDITATION.STATUS%TYPE,
        premarks IN VARCHAR2,
        ptags IN VARCHAR2,
        pdatefrom IN ACR_ACCREDITATION.DATEFROM%TYPE,
        pdateto IN ACR_ACCREDITATION.DATETO%TYPE)
