        STATUS=pstatus WHERE  
        ACCRENO=paccount AND STATUS!='2';
     ELSE
        UPDATE ACR_GB.ACR_ACCREDITATION SET STATUS=pstatus WHERE  ACCRENO=paccount AND STATUS='2';
     END IF;
      -- UPDATE ACCREDITATION STATUS
       VALUES (paccount,pstatus,pdateaction,pcreatedby,premarks,pdatefrom,pdateto);
      -- UPDATE MANAGING BOARD TABLE
      UPDATE ACR_GB.ACR_MB_TBL SET STATUS=pstatus WHERE CONNUMBER=paccount;
       
        Message:='SUCC';
        Code:=00;
Exception
when others then
