            WHERE HCFID=phcfid AND STATS='2' AND CONID=uconid AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    END IF;
ELSE
    IF(uconid=0) THEN
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(AMOUNT) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' GROUP BY HCFID;
        ELSE
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(AMOUNT) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' AND TRANCHID!=utranchid GROUP BY HCFID;
        END IF;
    ELSE
        IF(utranchid=0) THEN
            OPEN v_result FOR 
            SELECT COUNT(HCFID) AS cCOUNT,
            SUM(AMOUNT) AS cTOTAL, 
            HCFID FROM ACR_GB.ACR_ASSETS_TBL
            WHERE HCFID=phcfid AND STATS!='2' AND CONID=uconid GROUP BY HCFID;
        ELSE
